 <!--Content-->\n\n              <!--Footer-->\n              <div class=\"layoutFooter float-left w-100\">\n                <button class=\"btn-outer btn_redouter_right btn-outer-margin float-right\" style=\"position: inherit\"\n                  (click)=\"disableEdit('dob')\">cancel</button>\n                <button class=\"txtasbutton btn btn-outer btn_red_right btnDone float-right mr-2\" style=\"position: inherit\"\n                  (click)=\"saveChange('dob')\">done</button>\n              </div>\n              <!--Footer-->\n            </div>\n            <!--Change Layout-->\n          </div>\n          <!--Date of Birth-->\n\n\n\n          <!--Style Preferences-->\n          <div class=\"row border-bottom-0 pb-2\" style=\"position:relative\">\n            <div class=\"col-4 p-2 colorlightGray\">\n              <div class=\"colorlightGray\">style preferences</div>\n            </div>\n            <div class=\"col-6  pl-2 pt-2 pb-2 pr-0\">&nbsp;</div>\n            <button class=\"col-2 text-right p-2 colorred txtasbutton cursor changeInterestBtn\" (click)=\"enableEdit('consumerInterest')\">\n              <i class=\"fa fa-caret-right\" aria-hidden=\"true\"></i>\n            </button>\n\n            <!--Change Layout-->\n            <div class=\"changelayoutWrapper\" *ngIf=\"editConsumerInterest\">\n              <!--Header-->\n              <div class=\"layoutHeading float-left w-100\">\n                Style Preferences\n                <img src=\"./assets/images/loader.gif\" *ngIf=\"loader_Interest\" class=\"float-right\" width=\"20\" />\n              </div>\n              <!--Header-->\n\n              <!--Content-->\n              <div class=\"layoutContent float-left w-100 mt-4 mb-2\">\n                <div class=\"interestImagesMyAc\" *ngFor=\"let interest of myAccountModel.profileInfo.consumerInterests\">\n                  <img (click)=\"selectInterest($event, interest)\" style=\"cursor: pointer\" src=\"{{interest.consumerInterestImagePath}}\"\n                    title=\"{{interest.consumerInterestImageName}}\" id=\"{{interest.id}}\" />\n                  <img class=\"aboluteImg\" src=\"./assets/images/select.png\" *ngIf=\"interest.selectImg\" />\n                  <span class=\"interestLabels\">{{interest.consumerInterestImageName}}</span>\n                </div>\n              </div>\n              <!--Content-->\n\n              <!--Footer-->\n              <div class=\"layoutFooter float-left w-100\">\n                <button class=\"btn-outer btn_redouter_right btn-outer-margin float-right\" style=\"position: inherit\"\n                  (click)=\"disableEdit('consumerInterest')\">cancel</button>\n                <button class=\"txtasbutton btn btn-outer btn_red_right btnDone float-right mr-2\" style=\"position: inherit\"\n                  (click)=\"saveChange('consumerInterest')\">done</button>\n              </div>\n              <!--Footer-->\n            </div>\n            <!--Change Layout-->\n\n            <div class=\"float-left w-100 ml-2\">\n              <div class=\"interestImagesMyAcSelected d-inline-block\" *ngFor=\"let interest of myAccountModel.profileInfo.consumerInterests\">\n                <img (click)=\"selectInterest($event, interest)\" style=\"cursor: pointer\" src=\"{{interest.consumerInterestImagePath}}\"\n                  title=\"{{interest.consumerInterestImageName}}\" id=\"{{interest.id}}\" />\n              </div>\n            </div>\n          </div>\n          <!--Style Preferences-->\n        </div>\n      </div>\n\n      <div class=\"col-12 p-0\">\n        <div class=\"myaccount_row\">\n          <div class=\"row border-bottom-0 pb-0\">\n            <div class=\"col-6 colorlightGray py-2\">\n              shipping addresses\n            </div>\n            <div class=\"col-6 pr-0\">\n              <button (click)=\"ShowAllAddress()\" class=\"col-sm-3 text-right float-right colorred txtasbutton cursor\">\n                <i class=\"fa fa-caret-down\" aria-hidden=\"true\"></i>\n              </button>\n            </div>\n          </div>\n          <!--Shipping Address-->\n          <div class=\"row\">\n            <div class=\"col-4 p-0\">\n              <button (click)=\"enableEdit('addShipping')\" class=\"txtasbutton colorred cursor\" style=\"padding-top: 0 !important\">add</button>\n            </div>\n\n            <div class=\"col-8 p-0\">\n              <!--Change Layout-->\n              <div class=\"changelayoutWrapper\" *ngIf=\"addShipping\">\n                <!--Header-->\n                <div class=\"layoutHeading float-left w-100\">\n                  Add Shipping Address\n                  <img src=\"./assets/images/loader.gif\" *ngIf=\"loader_shippingAddress\" class=\"float-right\" width=\"20\" />\n                </div>\n                <!--Header-->\n\n                <!--Content-->\n                <div class=\"layoutContent float-left w-100 mt-4 mb-2 text-center\">\n                  <form [formGroup]=\"addShippingAddressForm\">\n                    <div class=\"form-group\">\n                      <input formControlName=\"addressLineOne\" type=\"text\" class=\"input-lg form-control\" placeholder=\"Address Line 1\" />\n                    </div>\n\n                    <div class=\"form-group\">\n                      <input formControlName=\"addressLineTwo\" type=\"text\" class=\"input-lg form-control\" placeholder=\"Address line 2\" />\n                    </div>\n\n                    <div class=\"form-group\">\n                      <input formControlName=\"addCity\" type=\"text\" class=\"input-lg form-control\" placeholder=\"City\" />\n                    </div>\n\n                    <div class=\"form-group\">\n                      <select formControlName=\"addStates\" type=\"text\" class=\"input-lg form-control\" placeholder=\"State\">\n                        <option value selected disabled hidden>State</option>\n                        <option *ngFor=\"let state of getStates\" value=\"{{state}}\">{{state}}</option>\n                      </select>\n                    </div>\n\n                    <div class=\"form-group\">\n                      <input (keypress)=\"core.allowOnlyNumbers($event)\" formControlName=\"addZipcode\"\n                        type=\"number\" class=\"input-lg form-control\" placeholder=\"Zip Code\" maxlength=\"5\" />\n                    </div>\n                    <div class=\"form-group\">\n                      <label class=\"form-check-label d-inline-block\">\n                          <input type=\"checkbox\" formControlName=\"appendAdddefaultShipping\" class=\"form-check-input\"> Set as default address\n                      </label>  \n                    </div>\n                    <div class=\"form-group errorMessages2 text-left mb-0\">\n                      {{errorValidationMessage}}\n                    </div>\n                  </form>\n                </div>\n                <!--Content-->\n\n                <!--Footer-->\n                <div class=\"layoutFooter float-left w-100\">\n                  <button class=\"btn-outer btn_redouter_right btn-outer-margin float-right\" style=\"position: inherit\"\n                    (click)=\"disableEdit('addShipping')\">cancel</button>\n                  <button class=\"txtasbutton btn btn-outer btn_red_right btnDone float-right mr-2\" style=\"position: inherit\"\n                    (click)=\"saveChange('addShipping')\">done</button>\n                </div>\n                <!--Footer-->\n              </div>\n              <!--Change Layout-->\n\n              <!--Edit Address-->\n              <div *ngIf=\"!addShippingAddress\" class=\"col-sm-12 row text-right\">\n                <div class=\"w-100\" *ngFor=\"let shippingAddress of myAccountModel.profileInfo.address; let i = index\">\n                  <div class=\"row\" *ngIf=\"shippingAddress.addressType == 'shippingAddress' && i <= addresscount\">\n                    <div class=\"col-12 text-right p-0 pb-2\" style=\"padding-top: 0 !important\" [ngClass]=\"{'default_shipping_red': (shippingAddress != undefined && shippingAddress.defaultAddress)}\">\n                      <span *ngIf=\"!shippingAddress.input_shippingAddress\">{{shippingAddress.addressLine1}}, </span>\n                      <span *ngIf=\"!shippingAddress.input_shippingAddress\">{{shippingAddress.addressLine2}}\n                        <span *ngIf=\"shippingAddress.addressLine2 != ''\">,</span>\n                      </span>\n                      <span *ngIf=\"!shippingAddress.input_shippingAddress\">{{shippingAddress.city}},</span>\n                      <span *ngIf=\"!shippingAddress.input_shippingAddress\">{{shippingAddress.state}},</span>\n                      <span *ngIf=\"!shippingAddress.input_shippingAddress\">{{shippingAddress.zipcode}}</span>\n\n                      <br />\n\n                      <div class=\"p-0 pull-right addDel_Icon colorred cursor\" *ngIf=\"!shippingAddress.input_shippingAddress\">\n                        <i class=\"fa fa-trash\" aria-hidden=\"true\" title=\"delete address\" (click)=\"confirmDeleteAddress(shippingAddress)\"></i>\n                        <button *ngIf=\"!shippingAddress.input_shippingAddress\" class=\"text-right  colorred txtasbutton cursor\"\n                          style=\"padding-top: 0 !important; cursor: pointer\" (click)=\"enableEdit('editShipping', shippingAddress)\">\n                          <i class=\"fa fa-caret-right\" aria-hidden=\"true\"></i>\n                        </button>\n                      </div>\n                    </div>\n                  </div>\n                </div>\n\n                <!--Change Layout-->\n                <div class=\"changelayoutWrapper\" *ngIf=\"editShipping\">\n                  <!--Header-->\n                  <div class=\"layoutHeading float-left w-100 text-left\">\n                    Edit Shipping Address\n                    <img src=\"./assets/images/loader.gif\" *ngIf=\"loader_shippingAddress\" class=\"float-right\" width=\"20\" />\n                  </div>\n                  <!--Header-->\n\n                  <!--Content-->\n                  <div class=\"layoutContent float-left w-100 mt-4 mb-2 text-center\">\n                    <form [formGroup]=\"editShippingAddressForm\">\n                      <div class=\"form-group\">\n                        <input formControlName=\"editaddressLineOne\" type=\"text\" class=\"input-lg form-control\"\n                          placeholder=\"Address Line 1\" />\n                      </div>\n\n                      <div class=\"form-group\">\n                        <input formControlName=\"editaddressLineTwo\" type=\"text\" class=\"input-lg form-control\"\n                          placeholder=\"Address line 2\" />\n                      </div>\n\n                      <div class=\"form-group\">\n                        <input formControlName=\"editCity\" type=\"text\" class=\"input-lg form-control\" placeholder=\"City\" />\n                      </div>\n\n                      <div class=\"form-group\">\n                        <select formControlName=\"editStates\" type=\"text\" class=\"input-lg form-control\" placeholder=\"State\">\n                          <option value selected disabled hidden>State</option>\n                          <option *ngFor=\"let state of getStates\" value=\"{{state}}\" selected=\"shippingAddress.append_editShippingState == state\">{{state}}</option>\n                        </select>\n                      </div>\n\n                      <div class=\"form-group\">\n                        <input (keypress)=\"core.allowOnlyNumbers($event)\" formControlName=\"editZipcode\"\n                          type=\"number\" class=\"input-lg form-control\" placeholder=\"Zip Code\" maxlength=\"5\" />\n                      </div>\n                      <div class=\"form-group\">\n                        <label class=\"form-check-label d-inline-block\">\n                          <input type=\"checkbox\" formContr