    MyordersComponent.prototype.getDeliveryDate = function (deliveryMethod, purchaseDate, leadTimeToShip) {
        leadTimeToShip == undefined ? leadTimeToShip = 0 : {};
        var weekday = new Array("Sunday", "Monday", "Tuesday", "Wednesday", "Thursday", "Friday", "Saturday");
        // Express: 3 to 5 business days Delivery
        if (deliveryMethod == 'Express: 3 to 5 business days') {
            var date = new Date(purchaseDate), locale = "en-us", month = date.toLocaleString(locale, { month: "long" });
            var getDay = new Date(date.getTime() + ((parseInt(leadTimeToShip) * 24) + 120) * 60 * 60 * 1000); //Calculating on the next 5days basis
            return weekday[getDay.getDay()] + ', ' + getDay.toLocaleString(locale, { month: "long" }) + ' ' + (getDay.getDate());
        }
        else if (deliveryMethod == '2 day: 2 business day shipping') {
            var date = new Date(purchaseDate), locale = "en-us", month = date.toLocaleString(locale, { month: "long" });
            var getDay = new Date(date.getTime() + ((parseInt(leadTimeToShip) * 24) + 48) * 60 * 60 * 1000); //Calculating on the next 5days basis
            return weekday[getDay.getDay()] + ', ' + getDay.toLocaleString(locale, { month: "long" }) + ' ' + (getDay.getDate());
        }
        else if (deliveryMethod == 'Standard: 5 to 8 business days') {
            var date = new Date(purchaseDate), locale = "en-us", month = date.toLocaleString(locale, { month: "long" });
            var getDay = new Date(date.getTime() + ((parseInt(leadTimeToShip) * 24) + 192) * 60 * 60 * 1000); //Calculating on the next 5days basis
            return weekday[getDay.getDay()] + ', ' + getDay.toLocaleString(locale, { month: "long" }) + ' ' + (getDay.getDate());
        }
        else if (deliveryMethod.indexOf('Custom') > -1) {
            var maxDay = deliveryMethod.substr(deliveryMethod.length - 3, 2).replace('(', '');
            var date = new Date(purchaseDate), locale = "en-us", month = date.toLocaleString(locale, { month: "long" });
            var getDay = new Date(date.getTime() + ((parseInt(leadTimeToShip) * 24) + (parseInt(maxDay) * 24)) * 60 * 60 * 1000); //Calculating on the next 5days basis
            return weekday[getDay.getDay()] + ', ' + getDay.toLocaleString(locale, { month: "long" }) + ' ' + (getDay.getDate());
        }
        else {
            var date = new Date(purchaseDate), locale = "en-us", month = date.toLocaleString(locale, { month: "long" });
            var getDay = new Date(date.getTime() + ((parseInt(leadTimeToShip) * 24) + 24) * 60 * 60 * 1000); //Calculating on the next 5days basis
            return weekday[getDay.getDay()] + ', ' + getDay.toLocaleString(locale, { month: "long" }) + ' ' + (getDay.getDate());
        }
    };
